I’m will be reminiscing on our time in Kona for months to come! I decided while I was there that I would enjoy the moments (there were a lot of them) and spend time once I return sharing how meaningful all of them were for me! 

On Valentine’s Day, Park Lane hosted a Red Party at this beautiful Salt Farm! I have dozens of photos from that night, today I’m sharing this one! 

I loved spending the evening dining with these women! I loved getting to know them better and them getting to know me better! I love that this team got to celebrate for entire week together and had the opportunity to form new relationships with new friends! 

This is what our business if all about! It’s about women supporting women and together, building a life that you can thrive in! 

@alisonde I’m incredibly proud of what you have built! Your love could not be stronger for your team and 2023 is going to be epic for you!

@laura_schwabel and @kellygwhalen I LOVED getting to watch you both experience your first Park Lane travel experience! They say once you earn and experience one, you never miss another! You both are just kind, amazing women and I can’t wait to travel the world with both of you! 

@slpteach2 I’m SO happy that you were one of the lucky winners on this trip! I actually don’t think luck@played a part at all! You were meant to be in Kona! Your energy and zest for our business is contagious! I’m SO glad you got a seat at the table of an incentive trip because you now see what’s possible and how anyone can earn these! You made this group of loving ladies complete and the trip was better with you on it! 

I feel very blessed to have spent an evening with this group!! I know @jonmefferd also enjoyed the laughs and conversation! 

Thank you to Park Lane Jewelry for bringing women like these four into my life! I’m immensely better because of it! 

